// src/components/Dashboard/StudentDashboard.js
import React from 'react';

const StudentDashboard = () => {
  return (
    <div className="dashboard">
      <h1>Welcome to Your Dashboard</h1>
      <p>Your personalized recommendations will be displayed here based on your interests and skills.</p>
      <div className="recommended-courses">
        <h3>Recommended Courses</h3>
        {/* Add dynamic course recommendations here */}
        <ul>
          <li>React for Beginners</li>
          <li>Advanced JavaScript</li>
        </ul>
      </div>
    </div>
  );
};

export default StudentDashboard;
